using System.Collections.Generic;
using System.Linq;

namespace AdventOfCode2018.Five
{
    public class DayFive : IAdventProblemSet
    {
        public const string Input = "";

        public string Description()
        {
            return "Alchemical Reduction";
        }

        public int SortOrder()
        {
            return 5;
        }

        public string PartA()
        {
            int unitsRemaining = CalculateUnitsRemainingAfterReactions(Input);
            return unitsRemaining.ToString();
        }

        public string PartB()
        {
            int bestSize = FindBestPolymerAfterRemovingAUnit(Input);
            return bestSize.ToString();
        }

        public int CalculateUnitsRemainingAfterReactions(string input)
        {
            List<char> characters = input.ToCharArray().ToList();
            bool doneProcessing;

            do
            {
                doneProcessing = true;

                for (int i = 0; i < characters.Count - 1; i++)
                {
                    if (characters[i] != characters[i + 1] && characters[i].ToString().ToUpper() == characters[i + 1].ToString().ToUpper())
                    {
                        characters.RemoveAt(i);
                        // Removes the i+1 value
                        characters.RemoveAt(i);

                        doneProcessing = false;
                        break;
                    }
                }
            } while (!doneProcessing);

            return characters.Count;
        }

        public int FindBestPolymerAfterRemovingAUnit(string input)
        {
            string[] letters = new[] { "a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z" };
            int smallestPolymer = int.MaxValue;

            foreach (string letter in letters)
            {
                string modInput = input.Replace(letter, "").Replace(letter.ToUpper(), "");

                int size = CalculateUnitsRemainingAfterReactions(modInput);

                if (size < smallestPolymer)
                    smallestPolymer = size;
            }

            return smallestPolymer;
        }
    }
}